import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

function ArticleEmployment(props) {
	return (
		<ComponentWrapper>
			<Link to="/wd/123">
				<header className="container-employment" />
				<div className="content-employment-body">
					<div className="job-card-position">
						프론트엔드 개발자(웹/앱)
					</div>
					<div className="job-card-company-name">하얀마인드</div>
				</div>
			</Link>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	.content-employment-body {
		padding: 14px 0;
		.job-card-company-name {
			color: #333;
			font-weight: 600;
		}

